	// "חנן": // DUP - SEE ABOVE // &Entry{Num: 2604, Word: "חֲנַן", Length: 3, Desc: "Strong&apos;s Number H2604: chanan (khan-an&#039;) v.\n1. to favor or (causatively) to entreat\n[(Aramaic) corresponding to H2603]\nKJV: shew mercy, make supplication. \nRoot(s): H2603"},
