	// "כרמי": // DUP - SEE ABOVE // &Entry{Num: 3757, Word: "כַּרמִי", Length: 4, Desc: "Strong&apos;s Number H3757: Karmiy (kar-mee&#039;) adj.\n1. a Karmite or descendant of Karmi\n[patronymically from H3756]\nKJV: Carmites. \nRoot(s): H3756"},
