	// "כרע": // DUP - SEE ABOVE // &Entry{Num: 3767, Word: "כָּרָע", Length: 3, Desc: "Strong&apos;s Number H3767: kara` (kaw-raw&#039;) n-f.\n1. the leg (from the knee to the ankle) of men or locusts (only in the dual)\n[from H3766]\nKJV: leg. \nRoot(s): H3766"},
