	// "נגד": // DUP - SEE ABOVE // &Entry{Num: 5047, Word: "נְגַד", Length: 3, Desc: "Strong&apos;s Number H5047: ngad (neg-ad&#039;) v.\n1. to flow (through the idea of clearing the way)\n[(Aramaic) corresponding to H5046]\nKJV: issue. \nRoot(s): H5046"},
