	// "נשה": // DUP - SEE ABOVE // &Entry{Num: 5384, Word: "נָשֶׁה", Length: 3, Desc: "Strong&apos;s Number H5384: nasheh (naw-sheh&#039;) n-m.\n1. rheumatic or crippled (from the incident to Jacob)\n[from H5382, in the sense of failure]\nKJV: which shrank. \nRoot(s): H5382"},
