	// "ספר": // DUP - SEE ABOVE // &Entry{Num: 5613, Word: "סָפֵר", Length: 3, Desc: "Strong&apos;s Number H5613: capher (saw-fare&#039;) n-m.\n1. a scribe (secular or sacred)\n[(Aramaic) from the same as H5609]\nKJV: scribe. \nRoot(s): H5609"},
